import React from "react";

function CreateCompany() {

    const handleSubmit = async (event) => {
        event.preventDefault();

        const formData = new FormData(event.target);

        formData.append('company_name', event.target.company_name.value);
        formData.append('company_logo', event.target.company_logo.files[0]);
        formData.append('company_address', event.target.company_address.value);
        formData.append('company_phone', event.target.company_phone.value);
        formData.append('company_email', event.target.company_email.value);
        formData.append('company_fax', event.target.company_fax.value);
        formData.append('company_website', event.target.company_website.value);
        // Access form data using formData.get('field_name')
        // Perform actions with the form data, e.g., make an API request

        try {
            const response = await fetch('localhost:8000/company/companies/', {
              method: 'POST',
              body: formData,
            });

            // Handle the response here
            console.log(response);
          } catch (error) {
            // Handle errors here
            console.error(error);
          }
      };


    return (
        <div>
            <p>Create New Company</p>
            <form onSubmit={handleSubmit}>
                <div>
                    <label>Company Name</label>
                    <input type="text" name="company_name" />
                </div>
                <div>
                    <label>Company Logo</label>
                    <input type="file" name="company_logo" />
                </div>
                <div>
                    <label>Company Address</label>
                    <input type="text" name="company_address" />
                </div>
                <div>
                    <label>Company Phone</label>
                    <input type="text" name="company_phone" />
                </div>
                <div>
                    <label>Company Email</label>
                    <input type="text" name="company_email" />
                </div>
                <div>
                    <label>Company Fax</label>
                    <input type="text" name="company_fax" />
                </div>
                <div>
                    <label>Company Website</label>
                    <input type="text" name="company_website" />
                </div>
                <div>
                    <input type="submit" value="Submit" />
                </div>
            </form>
        </div>
    );
}

export default CreateCompany;
